  - content: >
      Я не могу больше скрываться в техах.

      Прошло уже 4 дня с момента, когда меня попытались убить

      Я вижу повсюду глаза, и они желают мне смерти.

      Их голоса эхом раздаются в этих темных коридорах, и все они называют моё имя.

      Я не могу больше никому доверять.

      Я не могу больше здесь находиться.

      Я не могу отсюда выбраться.

      Я не могу себе помочь.

      Я не могу продолжать.

      я неь моогггъ уу у

      лмммлппп

      мама
