- uid: 8047
  type: BookBase
  components:
  - desc: Статья, пошагово описывающая процесс синтеза метамфетамина.
    name: Варка мета для чайников
    type: MetaData
  - pos: -170.57234,41.619003
    parent: 1
    type: Transform
  - content: >
      Как варить метамфетамин как белый человек (химик)

      1) Набираем 5 сварочного топлива в мензурку.

      2) в раздатчике добавляем 2 углерода 2 водорода, получаем масло.

      3) В раздатчике добавляем 1 азот 3 водорода, получаем аммиак.

      4) Добавляем 3 этанола, из аммиака получаем диэтиламин.

      5) Убираем излишки в химмастере, оставляем 6 масла и 6 диэтиламина.

      6) Добавляем 6 сахара и 6 водорода - получаем 24 эфедрина.

      7) Добавляем по 24: фосфор, йод, углерод.

      8) Греем в микроволновке пока состав не поменяет цвет на белый (примерно 80 секунд).

      9) На выходе получаем 96u чистейшего белого метамфетамина.
    type: Paper
- uid: 8048
  type: BookBase
  components:
  - desc: 'Лучше вам в эту книгу не заглядывать... '
    name: Опасный рецепт
    type: MetaData
  - pos: -173.80473,39.47501
    parent: 1
    type: Transform
  - content: >
      Таблетка "огненное дыхание" или ИНЖЕНЕРЫ ГДЕ СВЕТ (взорвали провод).

      Во время одной смены я решил распространить такую особенную таблетку, которая заставляла людей рыгать и взрываться, ну и конечно провода, трубы и пол это повреждало.

      Рецепт таблеток (они делают больно в небольшом радиусе) очень прост: 20 единиц ипекака и 30 единиц калия, скормить и наблюдать, заставь людей почувствовать себя драконом извергающим пламя.

      Подпись: GerrMidas
    type: Paper
- uid: 8049
  type: BookRandom
  components:
  - desc: 'Обложка книги изрисована цветными мелками и липнет из-за разлитой на неё газировки. Пахнет смешно. '
    name: АНАЛКАРНАВАЛ!
    type: MetaData
  - pos: -166.53908,41.570137
    parent: 1
    type: Transform
  - content: "Руководство на АНАЛКАРНАВАЛ для клоунов:\r\r\n \nВ основном оружие лютых хихишек это - Импровизированная пневматическая пушка. Она делается в меню <<Оружие>>, в крафте.\rОна состоит из 6 стали, трубы и кабельных стяжек.\rРассмотрим каждый пункт по отдельности:\r\n- 6 стали: легко найти в техах, можно попросить у РнД, на крайний случай что-нибудь разобрать\r\n- Труба: Делается из 2 ед. стали. Чтобы получить трубу её надо разместить на полу без плитки и открутить её гаечным ключом\n- Кабельные стяжки: Можно добыть в СБ или сделать самому из 15 проводов. \nИтак мы получили хихишкину приколюху, в неё можно засунуть всё что угодно, буквально. Чтобы  использовать пушку надо зарядить в неё баллон - обязательно большой, а не аварийный. Заряжаем пушку и готово - АНАЛКАРНАВАЛ приближается! В пушку лучше всего заряжать открытые банки газировки, но лучше всего заряжать емкости с космической смазкой-на ней поскальзываются почти все.\rНе забывайте заряжать ваш баллон!\rСЛАВА ХОНКОМАТЕРИ! ДА БУДЕТ АНАЛКАРНАВАЛ!\n"
    type: Paper
