  - content: "2 ед. эля + 1 ед. пива = мужественный дворф\n \n2 ед. водки + 1 ед. апельсинового сока = отвёртка\n \n1 ед. апельсинового сока + 1 ед. сока лайма + 1 ед. содовой = кира специальный\n \n2 ед. виски + 1 ед. сливок = ирландские сливки\n(если добавить эля, получится ирландская автомобильная бомба)\n \n1 ед. виски + 1 ед. сока лайма + 1 ед. железа = удар бипски\n \n2 ед. водки + 1 ед. кофейного ликёра = чёрный русский\n(добавить 2 ед. сливок и получится белый русский)\n \n1 ед. кофе + 1 ед. космического маунтин винда = переписчик\n \n2 ед. виски + 1 ед. колы = виски кола\n(смешать с пивом и выйдет бомба синдиката)\n"
    type: Paper
