- uid: 17578
  type: BookRandom
  components:
  - desc: Книга, содержащая всего один, и к тому же весьма сомнительный рецепт. Обязательно к прочтению!
    name: Книга рецептов
    type: MetaData
  - pos: -170.56772,37.570297
    parent: 1
    type: Transform
  - content: >
      Мой батя ебашит вообще адовые блюда.Ну такой вот примерно рецепт усредненный, потому что вариаций масса.Берется хлеб, он не греется, греть - это не про моего батю. Он берет это хлеб, вываливает его на сковороду и начинает жарить. Добавляет в него огромное количество бананов и МУКИ! для вязкости, универсальный фермент сверху. Все это жарится до дыма. Потом снимается с огня и остужается на в космосе. Потом батя заносит и щедро полив космической смазкой начинает есть. При этом ест со сковороды шкрябая по ней самодельным копьём. Ест и приговаривает полушепотом ух артём. При этом у него на лбу аж пот выступает. Любезно мне иногда предлагает, но я отказываюсь. Надо ли говорить о том какой дичайший пердеж потом? Миазмы стоят такие, что даже крысы откидываются.
    type: Paper
