- uid: 23328
  type: BookRandom
  components:
  - desc: Это руководство обучит вас выживанию, когда никто не хочет вашего выживания. Немного устаревшее.
    name: Руководство по выживанию - 1 часть
    type: MetaData
  - pos: -170.66597,39.454018
    parent: 1
    type: Transform
  - content: "так, на станции ещё ничего не произошло, но Аллах/будда/ЦК послали вам знание о том, что пиздец уже скоро будет?\r\rПришло время работать.\r\rПока станция ещё в рабочем состоянии все, отделы должны работать как обычно, но на 148%\n \n\r\rРнд:\n\r1)Любым способом максимально быстро сделать протолат для карго. В теории можно взять платы из хранилища, а в совсем хуевой ситуации даже отдать свой родной.\r\r\n2) надыбать себе золото пока это ещё возможно. \r\r\n3)Изучить технологии необходимые для жизни станции(рипли, хонк-боты и фабрикаторы оружия идут нахуй, плак-плак) и выйти в производство гранат как можно скорее.\n \nКарго:\n0) хорошей идеей будет попросить часть утилей поработать грузчиками, т.к. в условиях ограниченого времени они будут приносить больше пользы\r\r\n1) Спиздить из ближайших техов вот прям вообще все ёмкости с топливом/водой кроме парочки, спиздить все автоматы, включая бесполезные автоматы с одеждой(договоритесь об этом с отделами)\r\r\n2) На эти деньги закупить самые необходимые заказы для станции и особенно для РНД и инжей(квас, пицца и горилла идут нахуй, простите) и материалы для запуска бизнеса на протолате\r\r\n3) наклепать и продать схем общей стоимостью примерно 40-60 тысяч и после этого по КД возить оружие и материалы. Шаттл не должен простаивать\r\r\n \nИнженеры:\n1) Всё как обычно + особенно следить за работоспособностью РНД и Карго, т.к. игра строится на них\r\r\n \nСБ:\n \n1) Всё как обычно + особенно следить за карго и рнд, чтобы там не было диверсий и толп грейтардов ломающих двери.\r\r\n2) При этом не толпится и не мешать отделам работать\r\n \nЧТОЖ, спокойное время кончилось и через пять минут на станции будут враги. Что делаем?\r\r\n1) Устраиваем оборону. Все наиболее важные люди и объекты в ИДЕАЛЕ должны быть в одном месте и под защитой. А именно: запас оружия и медикаментов, командные консоли, клонерка, главы отделов, ядерка и диск\n2) разрешаем ношение оружие для всех желающих и устраиваем адекватную раздачу оружия(не по 5 штук в руки, окей?)\r\n3) блять. не даем толпам блять рандомных блять пассажиров блять выламывать двери и окна в месте обороны. Лучше сразу застрелить нахуй, чем остаться без оружия и с дырой в стене\n \nПерехожу к самому вкусному, самому важному и вообще тому ради чего этот гайд и писался\nВеликая и ужасная - Тактика обороны и ведения боя.\n1) Лазеры Дедов НАМНОГО мощнее чем лазеры доступные станции, поэтому баррикады лучше строить не из стекла, а все окна и стеклянные шлюзы застраивать к хуям собачим\n2) У дедов ебейшая защита от всего. От всего кроме огня, химикатов и не летального оружия(станбатоны и дизейблеры). А, ну и да, гипоспрей имба и не контриться. А значит главным оружием будут огнеметы(могут делать обычные химики из огнетушителей), сигнальные ракеты/зажигательные патроны(бармен и СБ, не жоптесь на них. Лучше 10 человек с одной ракетой, чем 1 с 10), гранаты(токсичный дым разъедающий скафандры и вырубающий человека имбует) и нелетал(можно всем гражданским раздать, карго закажет)\n"
    type: Paper
