  - content: >
      3)Темнота друг молодёжи. И станции. Разбейте все лампы или обесточьте коридоры. Используйте тактику небольших засад и набегов. Два человека со станбатонами подошедшие вплотную к деду ГАРАНТИРОВАНО его убьют.

      4) По личным наблюдениям у 90% дедов нету инструментов вообще. Поэтому обесточенные или поставленные на болты двери задержат их на ОЧЕНЬ большой срок. Или даже убьют


      5) Деды будут рады если вы устроите им газовые камеры или плазменное шоу в местах стыковки со станцией(или прям у бомбы, лол)


      6) В 90% случаев шаттл дедов никто не защищает, или защищает один человек. Если небольшой отряд заштурмует их шаттл - это пиздец вин


      7) В теории можно ещё квадроциклы юзать, чтобы враги ну просто ахуели.


      8)Рипли хуйня. Скорость=жизнь


      9)Рипли хуйня
