  components:
  - desc: Небольшое руководство, содержащее немного информации про полезные лечебные растения.
    name: Памятка ботанику-химику
    type: MetaData
  - pos: -172.54733,37.49906
    parent: 1
    type: Transform
  - content: >
      Руководство по ботанике для химиков (то есть какие растения вам очень помогут и помогут медблоку)

      Хоть медблок может и производить лекарства, все же ботаники могут облегчить или подогнать то, что вы создать не в состоянии или занимает мноого времени

      Так вот,

      2 растения которые желательны для медблока:

      Галакточертополох и линчжа

      Первый при перемалывании снабжает вас таким медикаментом, как стебилин, который является лучшим антитоксином (лечит 8 яда за единицу)

      Второй снабжает ультраваскулином (средний по эффективности антитоксин, лечит 6 яда и наносит легкие тупые травмы, но имеет передоз в 30 единиц) и эпинефрином. Что это такое, думаю знают все.
    type: Paper
