- uid: 24099
  type: BookRandom
  components:
  - desc: История неизвестного автора.
    name: Сражение с королевой
    type: MetaData
  - pos: -220.25093,-10.474344
    parent: 1
    type: Transform
  - content: "Сражение с Королевой\n \nГлава Персонала Джексон Першинг прибыл на станцию... Вокруг разруха, кровь, сломанные стены. Он попытался узнать, что происходит, но внятного ответа так и не дождался. Джексон, не долго думая, побежал в ЕВА за скафандром, но внутри было уже пусто. За дверью он обнаружил изуродованный нечтом труп атмосферного техника. Со словами \"Ему это уже не пригодиться\" Джексон одел его костюм на себя. \"Нужно дойти до своего кабинета и взять табельное оружие!\" - подумал Першинг и отправился через дырку на мостике в свой кабинет. Оружие взято, заряжено, одето на пояс. Джексон решил пойти в телепортную, для изучения происходящих там странных звуков...\n \nДверь, издав страшный звук, отворилась... По полу прошёл дым и Джексон сквозь него увидел тёмную фигуру с хвостом. \"Твоюж мать!\" - вскрикнул Джексон и достал свой лазер, но фигура резко вскочила на него и повалила с ног! Лазер закатился под соседний стол! Над Першингом стояло ужасающие нечто... Это была королева чужих. Она безжалостно била его в ногу и прилепила к его голове маленькую личинку! Прямо прилепила на голову! Джексон, ни черта невидящий, пытался скинуть королеву с себя! Он боролся, бултыхался, отползал! Першинг был не дурааак... И в конце-концов притворился мёртвым. Королева отошла от него и начала выкладывать свои яйца прямо около \"трупа\"...\n \nВыждав момент, наш герой подвинул личинку со своего лица так, что бы один глаз видел происходящее, достал свой лазер из под стола и, едва встав, начал КРИТИЧНО без жалости стрелять в спину чужому! \"click\" - услышал Джексон и понял, что дела обстоят ещё хуже, чем он думал. Королева развернулась и начала бежать за ним! Першинг, запутав королеву, успел закинуть свой лазер в перезарядник! Наш Герой и Королева встретились взглядами... Между ними стоит яйцо. Как дети, они начала кружиться вокруг этого яйца, меняя направления, что бы поймать или убежать друг-от-друга. Момент истины. Перезарядник закончил свою работу и оставалось только взять лазер. Оба персонажа этой истории кинулись к лазеру! Джексон взял его, но вдруг ощутил сильнейший удар в правую пятку (Ахилесова пята) и упал... Удар, за ударом наносила Королева Чужих. Глаза начали то темнеть, то переливаться красным...\n \nКоролева, раненная и измученная, закончила свои дела и попыталась смыться, но Джексон был сильнее, чем казалось даже ему. Он из последних сил, истекая кровью, встал. Опираясь об стену он добрался до угла и начал нажимать на курок, как эпилептик грызёт ложку. Последний выстрел обоймы... Чёрная фигура издала громкий выкрик и упала на пол. Джексон в ярости хотел пробить ей голову огнетушителем, но сил уже не хватало и он упал.\n \nИз корридора стали слышны возгласы. Группа выживших нашли Нашего Героя! Подняли его на ноги, наложили шину, попутно поражаясь геройству Главы Персонала...\n \nНо это уже совсем другая история.\n"
